import {Helmet} from 'react-helmet';

const Home = () => {
    return (
        <div className="container-fluid bg-light text-center py-5"> 
            <Helmet>
                <title>Home</title> 
            </Helmet>
            <h1 className='fw-bold'>Calendar</h1>
            <p>Hello, my name is Ramiyan Gangatharan and this is my attempt at creating a calendar app</p>
            <div>
                <form>
                    <label for = "name">Username: </label>
                    <input type="text" id="name" name="name" placeholder="Enter your name"></input>
                </form>
            </div>
        </div>
    );
};

export default Home;
